import Vue from 'vue'
import VueRouter from 'vue-router'
import ResourcePage from '../views/ResourcePage.vue'
import DemoPage from '@/views/demo/index.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    component: ResourcePage
  },
  {
    path: '/tickets',
    component: () => import('@/tickets/index.vue')/*
    component: () => import('@/tickets/index.vue')  箭头函数
    类似等价 
    component(){
      return import('@/tickets/index.vue')
    }
    类似等价
    component: function(){
      return import('@/tickets/index.vue')
    }
    */
  },
  {
    path: '/forum',
    component: () => import('@/forum/')
  },
  {
    path: '/faq',
    component: () => import('@/faq/')
  },
  {
    path: '/demo',
    component: DemoPage
  },
]

const router = new VueRouter({
  routes,
  mode: 'hash',
})

export default router
